  match prodIdx with
    | 0 -> NONTERM__startProg 
    | 1 -> NONTERM_Prog 
    | 2 -> NONTERM_Window 
    | 3 -> NONTERM_Window 
    | 4 -> NONTERM_Window 
    | 5 -> NONTERM_Window 
    | 6 -> NONTERM_UIElements 
    | 7 -> NONTERM_UIElements 
    | 8 -> NONTERM_UIElement 
    | _ -> failwith "prodIdxToNonTerminal: bad production index"

